import React from 'react';
import logo from '../../src/logoTC.png';

function MessagePage() {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', height: '100vh' }}>
      <img src={logo} alt="Logo" style={{ width: '200px', height: '200px', marginTop: '50px' }} />
      <h1 style={{ textAlign: 'center', fontFamily: 'Lobster Two', fontStyle: 'italic', marginTop: '30px' }}>Leave your Message!</h1>
      <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', width: '80%', marginTop: '50px' }}>
        <label style={{ marginBottom: '10px' }}>
          Message:
        </label>
        <textarea style={{ height: '200px', width: '100%', marginBottom: '20px' }} />
        <div style={{ display: 'flex', justifyContent: 'space-between', width: '100%' }}>
          <button style={{ fontWeight: 'bold', padding: '10px 20px' }}>Choose</button>
          <button style={{ backgroundColor: '#4CAF50', color: 'white', fontWeight: 'bold', padding: '10px 20px' }}>Submit</button>
        </div>
      </div>
    </div>
  );
}

export default MessagePage;
